var tipuesearch = {"pages": [{'title': '網際網路', 'text': '', 'tags': '', 'url': '網際網路.html'}, {'title': '課程心得', 'text': '這個課程讓我受益匪淺也學習不少知識。 \n 在不了解怎麼編輯時的我除了問老師也有問我的父親因為他也從事類似的工作讓我認識不少實用的軟體。 \n', 'tags': '', 'url': '課程心得.html'}, {'title': '以token推送的坎坷過程', 'text': '仔老師跟我說我在github倉儲上只有執行三次時我發現原來我之前做的內容都沒有傳送上去，可能是推送出了些問題所以我去github看發現我的token過期了需要重新設定，我複製完token后去我的wcm2022的git倉儲找出我的config內設定我token的檔案來做修改，修改後去cmd提交檔案(acp "第二次提交")時cmd還需要我github的名稱及電子信箱 \n Y:\\wcm2022>git config --global user.email "51033112@gm.nfu.edu.tw" \n Y:\\wcm2022>git config --global user.name "510Benson" \n 后就推送成功啦!!!', 'tags': '', 'url': '以token推送的坎坷過程.html'}, {'title': '評分依據', 'text': '', 'tags': '', 'url': '評分依據.html'}, {'title': '俄羅斯方塊', 'text': '', 'tags': '', 'url': '俄羅斯方塊.html'}, {'title': 'run', 'text': 'ROC 國旗規格   PROC 國旗規格   USA 國旗規格 \n Gist Brython scripts \n 解題練習 \n Cango \n \n \n \n \n  for ggame  \n \n \n \n \n \n \n \n \n  Cango 程式庫  \n \n \n \n \n \n \n \n \n  for Konva 程式庫  \n \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n add 1 to 100 p261 ROC flag PROC flag USA flag Draw Grid Random Rect Rect Walk Rect U Walk Rect rev U Walk 單節貪食蛇 5 個紅點方塊 Snake BSnake auto_guess ball bezier big_lotto brython_kw bunny cango_spur cango_spur1 cango_three_gears clear clock convert_temp deepmerge display_stl draw ex1 ex2 ex3 ex4 fibo fourbar guess_a_number hw1_1 hw1_2 Keycode knova1 merge3 power_lotto spur spur_w_form stl_binary_ascii stl_writer Tetris Auto Tetris turtle1 turtle2 turtle3 turtle4 turtle5 turtle6 turtle7 turtle8 twl_link_ik webcam websocket ycqsort \n  ######################  editor1 開始 ######################  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n  這裡的畫布 id 為 brython_div  \n \n  graphics-column is for ggame  \n \n  ######################  editor1 結束 ######################  \n  以下可以開始利用 editor1 的設定編寫對應 Brython 程式  \n \n  以上為內建程式, 頁面可透過 ?src=gist_url 執行  \n  add 1 to 100 開始  \n \n \n 導入 brython.js 程式庫 \n \n \n 導入 brython_stdlib.js 標準程式庫 \n \n \n \n 啟動 brython \n \n \n \n 執行所需要的 Brython 程式 \n \n \n \n 導入 brython.js 程式庫 \n \n \n \n 導入 brython_stdlib.js 標準程式庫 \n \n \n \n 啟動 brython \n \n \n \n 執行所需要的 Brython 程式 \n \n \n \n 導入 brython.js 程式庫 \n \n \n \n 導入 brython_stdlib.js 標準程式庫 \n \n \n \n 啟動 brython \n \n \n \n 執行所需要的 Brython 程式 \n \n \n \n', 'tags': '', 'url': 'run.html'}, {'title': '期末任務', 'text': '', 'tags': '', 'url': '期末任務.html'}, {'title': '英國國旗', 'text': '', 'tags': '', 'url': '英國國旗.html'}, {'title': '過程及心得', 'text': '這是一個痛苦又寶貴的經驗，在收到這個課題時我馬上就去尋找相關資料我找到類似的圖形，但是他的格式及尺寸大小不符所以我就以我聰慧的大腦展開了兩天的修改及debug。 在我修改的過程中我使用了一個簡稱vscode的軟體這讓我在工作時變得方便及更有效率，我從網路找了一些範本卻因為一些版本不同無法使用，所以我決定要ROC國旗跟我找到的資料結合來把UK國旗做出來。\xa0 \n 一開始我用ROC國旗內的程式碼先複製到VScode裡面再開一面給英國國旗範本然後在各取所需把範本內的資料替換到ROC國旗的原本畫圖的部份把啟動資料庫及Brython環境的東西留了下來，二來先試試是否能啟動再來看有沒有哪裡有bug，我在啟動時無法畫出來的話我會使用F12這個按鍵呼叫出程式碼，它會顯示我是否在編寫時有無錯誤跟錯誤的原因、地點，例如我在修改時會一個一個動作修改，再去找原因一個個解決，我在更改角度時因為python跟Javascript關於Math.Pi的大小寫應用的地方也不相同讓我困惑了好一陣子。 \n 修改數字也是麻煩要一個個改非常枯燥但是改完成功的成就感非常滿足。 修改及debug的過程就是一直在試錯直到沒有錯為止是非常需要經驗跟想像力來思考是哪裡出錯跟出錯的位置然後再來做更新。 \n 這次作業是非常寶貴及痛苦的經驗，所以我覺得「失敗為成功之母」是非常適合詮譯這份工作。 \n \n', 'tags': '', 'url': '過程及心得.html'}]};